            "id": "1782079675298206200",
            "text": "@Betsycashmoney @BroadnaxWrites Yeah old NBA wisdom is never treat steals leaders as proof of defensive monsters. Magic led the league in that category once and Lakers used to hide him. It\u2019s why All-D teams when coaches picked em seemed a wise plan, wiser now with all these D stats being inconclusive"
